const { jsPDF } = require("jspdf");
require('jspdf-autotable')
const path = require('path')

var IMG = 'data:image/png;base64,';

async function PDFStatus(datos) {  //lista el total de Clientes. 
    var array = JSON.parse(datos.jsonTelefonos);

    function dateNow() {
        var today = new Date();

        // obtener la fecha y la hora
        var now = today.toLocaleString();
        return now

    }

    function generateUUID() {
        var d = new Date().getTime();
        var uuid = 'xxxxxxxxxxxx4xxxyxxxxxxxxxxxxxxx'.replace(/[xy]/g, function (c) {
            var r = (d + Math.random() * 16) % 16 | 0;
            d = Math.floor(d / 16);
            return (c == 'x' ? r : (r & 0x3 | 0x8)).toString(16);
        });
        return uuid;
    }
    let doc = new jsPDF({ lineHeight: 1.5 });
    let date = new Date()
    let day = date.getDate()
    dataUII = generateUUID()

    doc.addImage(IMG, 'png', 170, 5, 30, 15)

    //doc.setFont('Helvetica', 'Bold')
    //doc.setTextColor('#07008f')
    //doc.text(120, 12, 'ESTADO DE CUENTA');

    doc.autoTable({
        body: [
            [
                {
                    content: 'ESTADO DE CUENTA',
                    styles: {
                        halign: 'left',
                        fontSize: 15,
                        font: 'Helvetica',
                        fontStyle: 'Bold',
                        cellPadding: { top: 6 },
                        textColor: '#07008f'
                    }
                }
            ],
        ],
        theme: 'plain',
        styles: {
            //fillColor: '#3366ff'
        }
    });

    var finalY = doc.lastAutoTable.finalY

    doc.autoTable({
        body: [
            ['Servicio Nacional de Aguas Subterráneas, Riego y Avenamiento'],
            ['Cédula Jurídica: 3007042041'],
            ['400 metros al este de la escuela Monseñor Luis Leipod'],
            ['Cañas, Guanacaste'],
            ['Teléfono: 2669-0676 EXT 207'],
            ['Email: sia@senara.com'],
        ],
        theme: 'plain',
        tableWidth: 'auto',
        columnStyles: {
            0: {
                halign: 'left',
                cellWidth: 'wrap',
                cellPadding: { top: 0, right: 2, bottom: 1, left: 0 }
            },
        },
        bodyStyles: {
            textColor: '#07008f',
            halign: 'right',
            fontSize: 8,
        },
        startY: 26,
    });

    doc.autoTable({
        head: [['Estado de cuenta #' + dataUII, '                   ', 'PDF Generado automáticamente el: ' + dateNow()]],
        headStyles: {
            fillColor: '#07008f',
            textColor: '#ffffff',
            halign: 'left',
            fontSize: 8
        },
        theme: 'grid',
        startY: 52,
        tableLineColor: '#07008f',
        tableLineWidth: 0.4,
    });

    doc.autoTable({ // [datos.nombre, datos.numeroFinca, datos.areaRegistral, datos.areaRegable, datos.sectorSiao]
        head: [['CLIENTE', 'PARCELA', 'DETALLE']],
        body: [
            [datos.nombreCompleto, 'Nombre: ' + datos.nombre, 'Tipo documento: Estado de cuenta'],
            ['Ced: ' + datos.cedula, 'Numero de finca: ' + datos.numeroFinca, 'Ciclo: ' + datos.mes + ', ' + datos.año],
            ['Email: ' + datos.email, 'Área registral: ' + datos.areaRegistral, 'Sucursal: Cañas'],
            [datos.provincia + ', ' + datos.canton, 'Área regable: ' + datos.areaRegable, ''],
            ['Tel: ' + array[0].telefono, 'Sector parcela: ' + datos.sectorSiao],
        ],
        headStyles: {
            fillColor: '#FFFFFF',
            textColor: '#07008f',
            halign: 'left',
            fontSize: 12,
            //cellPadding: { top: 1, right: 2, bottom: 1, left: 0 }
        },
        bodyStyles: {
            textColor: '#07008f',
            halign: 'left',
            fontSize: 8,
            lineColor: '#ffffff',
            cellPadding: { top: 1, right: 0, bottom: 1, left: 0 }
        },
        theme: 'plain',
        startY: 60,
        tableLineColor: [255, 255, 255],
        tableLineWidth: 0.4,
    });

    doc.setDrawColor('#07008f');
    doc.line(14, 67, 196, 67); // horizontal line


    datos.WaterIntakes.forEach(function (ClientDato, index) {
        let info = []
        if (ClientDato.idTipoMedicion == 1) {
            ClientDato.crops.forEach(function (Data, index) {
                info.push([Data.cultivo, Data.areaCultivo, (new Intl.NumberFormat('es-MX').format(Data.subtotalMetrosCubicos)), (new Intl.NumberFormat('es-MX').format(Data.subtotalVolumenLitros))])
            })

            doc.autoTable({
                head: [['Toma:' + ClientDato.TOMA, 'Metros Cubicos:' + (new Intl.NumberFormat('es-MX').format(ClientDato.TOTALMETROSCUBICOS)), 'Volumen Litros:' + (new Intl.NumberFormat('es-MX').format(ClientDato.totalVolumenLitros)), 'Monto:' + (new Intl.NumberFormat('es-MX').format(ClientDato.totalMonto))]],
                headStyles: {
                    fillColor: '#07008f',
                    textColor: '#FFFFFF',
                    halign: 'left',
                    fontSize: 8,
                    //cellPadding: { top: 1, right: 2, bottom: 1, left: 0 }
                },
                theme: 'plain',
                cellPadding: 0,
                startY: doc.lastAutoTable.finalY + 3
            });

            doc.autoTable({
                head: [['Cultivo', 'Area de cultivo', 'Metros cúbicos', 'Total litros']],
                body: info,
                headStyles: {
                    fillColor: '#FFFFFF',
                    textColor: '#000000',
                    halign: 'left',
                    fontSize: 8,
                    font: 'Helvetica',
                    fontStyle: 'Bold',
                    //cellPadding: { top: 1, right: 2, bottom: 1, left: 0 }
                },
                bodyStyles: {
                    textColor: '#000000',
                    halign: 'left',
                    fontSize: 8,
                    lineColor: '#6b7280'
                },
                theme: 'striped',
                tableLineColor: [255, 255, 255],
                tableLineWidth: 0.4,
                cellPadding: 0,
                startY: doc.lastAutoTable.finalY + 1
            });
        }
        info = []
    })



    let TotalMonto = 0;

    datos.WaterIntakes.forEach(function (ClientDato) {
        if (ClientDato.idTipoMedicion == 1) {
            TotalMonto += ClientDato.totalMonto;
        }
    });

    doc.autoTable({
        body: [
            ['Servicios Gravados:', '¢' + (new Intl.NumberFormat('es-MX').format(TotalMonto.toFixed(2)))],
            ['Servicios Exento:', '¢0.00'],
            ['Total Gravado:', '¢' + (new Intl.NumberFormat('es-MX').format(TotalMonto.toFixed(2)))],
            ['Total Exento:', '¢0.00'],
            ['IVA:', '¢' + (new Intl.NumberFormat('es-MX').format((TotalMonto * 0.13).toFixed(2)))],
            ['Descuento:', '¢0.00'],
            ['TOTAL:', '¢' + (new Intl.NumberFormat('es-MX').format(((TotalMonto * 0.13 + TotalMonto).toFixed(2))))],
        ],
        theme: 'plain',
        tableWidth: 'auto',
        //halign: 'right',
        //startY: 130,
        columnStyles: {
            0: {
                fillColor: [255, 255, 255],
                textColor: '#07008f',
                halign: 'right',
                cellWidth: 'wrap',
                fontStyle: 'bold',
                cellPadding: { top: 1, right: 2, bottom: 1, left: 78 }
            },
            1: {
                fillColor: [7, 0, 143],
                textColor: '#FFFFFF',
                halign: 'right',
                cellWidth: 'wrap',
                fontStyle: 'bold',
                cellPadding: { top: 1, right: 6, bottom: 1, left: 0 }
            }
        },
        bodyStyles: {
            textColor: '#07008f',
            halign: 'right',
            fontSize: 8,
        },
        styles: {
            //columnWidth: "wrap"
        },
    });

    doc.autoTable({
        body: [
            [
                {
                    content: 'Observaciones',
                    styles: {
                        halign: 'left',
                        fontSize: 12,
                        fontStyle: 'bold',
                        textColor: '#07008f'
                    }
                }
            ],
            [
                {
                    content: 'Toda cuenta devengará intereses de 2,5% mensual por mora.  '
                        + 'Es DEBER del usuario solicitar semestralmente la incorporación de sus planes de'
                        + 'cultivo del Plan de Riego antes de Abril y el 15 de Octubre de cada año.',
                    styles: {
                        halign: 'left',
                        textColor: '#07008f'
                    }
                }
            ],
        ],
        theme: "plain"
    });

    //doc.save(rutaAbsoluta + '/' + datos.cedula + '-' + day + datos.año + '- ' + dataUII + '.pdf')
    console.log('PDF Creado: ' + datos.email);
    const rutaAbsoluta = path.resolve('public', 'PDFS')
    doc.save(rutaAbsoluta + '/' + datos.cedula + '_' + day + datos.año + '.pdf')
    return (rutaAbsoluta + '/' + datos.cedula + '_' + day + datos.año + '.pdf');
}

module.exports = {
    PDFStatus: PDFStatus
}